import React from 'react';
import { Link, useLocation } from 'react-router-dom';

const Breadcrumbs = () => {
  const location = useLocation();
  const pathnames = location.pathname.split('/').filter((x) => x);

  const displayNameMapping = {
    'manage-companies': 'Manage Companies',
    'add-company': 'New Company Form',
    // Add more mappings as needed
  };

  return (
    <div className="text-xl">
      <Link to="/" className="text-xl hover:text-blue-600">Home</Link>
      {pathnames.map((value, index) => {
        const isLast = index === pathnames.length - 1;
        const to = `/${pathnames.slice(0, index + 1).join('/')}`;
        const displayName = displayNameMapping[value] || value;

        return (
          <span key={to} className="text-xl">
            {' > '}
            {!isLast ? (
              <Link to={to} className="text-xl hover:text-blue-600">{displayName}</Link>
            ) : (
              <span className="text-xl">{displayName}</span>
            )}
          </span>
        );
      })}
    </div>
  );
};

export default Breadcrumbs;
